import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import "bootstrap/dist/js/bootstrap.bundle.min";

function Login(){
    return(
            <div className="d-flex justify-content-center align-items-center vh-100" id="logindiv">
                <form>
                    <div className="mb-3">
                    <label className="form-label">Enter Your Email Id :</label>
                    <input type="email" className="form-control" id="email" placeholder="Enter you Email Id" required/>
                    </div>
                    <div className="mb-3">
                    <label className="form-label">Enter Your Password :</label>
                    <input type="password" className="form-control" id="password" placeholder="Enter your Password" required/>
                    </div>

                    <div className="col-12">
                        <button type="submit" className="btn btn-primary">Sign in</button>
                    </div>
                </form>
            </div>
    )
}

export default Login;
